/*Table structure for table `sys_userinfo` */

DROP TABLE IF EXISTS `sys_userinfo`;

CREATE TABLE `sys_userinfo` (
  `id` varchar(32) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `appId` varchar(32) CHARACTER SET utf8 DEFAULT NULL,
