  `parentId` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '主账号',
  `avatarUrl` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '头像用户',
  `ename` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '英文名',
  `pwd` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '登录密码',
  `token` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '第三方token',
  `tel` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '电话',
  `fax` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '传真',
  `email` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '邮件',
  `mobile` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '移动电话号码',
  `qq` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT 'QQ',
  `userType` int(1) DEFAULT NULL COMMENT '0-主账号；1-子账号；2-app账号',
  `balance` double DEFAULT '0' COMMENT '余额',
  `status` int(11) DEFAULT NULL COMMENT '账号状态：0未启用，1正常，2、异常，3冻结',
  `bankAccount` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '银行账号',
  `idCard` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '身份证号码',
  `provinceCode` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '省',
  `provinceName` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '省',
  `cityCode` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '市',
  `cityName` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '市',
  `regionCode` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '区',
  `regionName` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '区',
  `address` varchar(256) CHARACTER SET utf8 DEFAULT NULL COMMENT '详细地址',
  `memo` varchar(64) CHARACTER SET utf8 DEFAULT NULL COMMENT '备注',
  `df` int(11) DEFAULT '0' COMMENT '是否删除',
  `creator` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '创建人',
  `uman` varchar(32) CHARACTER SET utf8 DEFAULT NULL COMMENT '修改人',
  `cdate` datetime DEFAULT NULL COMMENT '创建时间',
  `mdate` datetime DEFAULT NULL COMMENT '最后修改时间',
  `version` int(11) DEFAULT '0' COMMENT '数据版本',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='用户信息表';

